import './App.css';

function App() {

    const users = [
        { id: 1, name: 'user1', surn: 'surn1', age: 30},
        { id: 2, name: 'user2', surn: 'surn2', age: 31},
        { id: 3, name: 'user3', surn: 'surn3', age: 32},
    ];

    const result = users.map((elem) => <li key = {elem.id}> {elem.name} {elem.surn} {elem.age} </li>);

  return <ul>
      {result}
  </ul>
}
export default App;
